    false,nt"url": null,nt"notes": "Environmental complaints received by the
    Department of Environment (DOE) from January 1993 to December 31, 2011 and by the
    Department of Public Health (CDPH) since January 1, 2012. On January 1, 2012, the
    DOE was disbanded and all its inspection, permitting, and enforcement authorities
    were transferred to the CDPH.   rnData fields requiring description are detailed
    below. rnCOMPLAINT ID:  This is the unique identifier of the complaint incident.
    rnCOMPLAINT TYPE: Specifies the type of complaint. CDPH complaint types are  u201cAbandoned
    Siteu201d, u201cAir Pollution Work Orderu201d, u201cAsbestos Work Orderu201d, u201cConstruction
    and Demolitionu201d, u201cToxics Hazardous Materials Work Orderu201d, u201dIllegal
    Dumping Work Orderu201d, u201cNoise Complaintu201d, u201cPermits Issued by DOE Work
    Orderu201d, u201cRecycling Work Orderu201d, u201cService Stations/Storage Tanks
    Work Orderu201d, u201cVehicle Idling Work Orderu201d, and u201cWater Pollution.u201d
    For consistency, historic DOE complaint types were renamed to match the most appropriate
    CDPH complaint type. DOE complaint types that had no matches are designated as u201cOther.u201d
     rnMAPPED LOCATION: Contains latitude/longitude coordinates of the site as determined
    through the Chicago Open Data Portalu2019s geocoding engine. In instances where
    the facility address is a range, the lower number (the value in the u201cStreet
    Number Fromu201d column) is used for geocoding. For example, for the range address
    1000-1005 S Wabash Ave, the Mapped Location would be the coordinates for 1000 S
    Wabash Ave. rn INSPECTOR: Contains the badge or ID number of the inspector or engineer
    who conducted the compliant inspection. rnCOMPLAINT DATE: Date complaint was received
    by the department. rnCOMPLAINT DETAIL: Brief description of the nature of the complaint.
     rnINSPECTION LOG: This is the inspectoru2019s narrative log of the complaint inspection.rnDATA
